INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(2, 'Effective Java (3rd Edition)', 'Joshua Bloch', '<div><div><b>The Definitive Guide to Java Platform Best PracticesUpdated for Java 7, 8, and 9</b></div><div>&nbsp;</div><div>Java has changed dramatically since the previous edition of&nbsp;<i>Effective Java</i>&nbsp;was published shortly after the release of Java 6. This Jolt award-winning classic has now been thoroughly updated to take full advantage of the latest language and library features. The support in modern Java for multiple paradigms increases the need for specific best-practices advice, and this book delivers.</div><div>&nbsp;</div><div>As in previous editions, each chapter of&nbsp;<i><b>Effective Java, Third Edition,</b>&nbsp;</i>consists of several items, each presented in the form of a short, stand-alone essay that provides specific advice, insight into Java platform subtleties, and updated code examples. The comprehensive descriptions and explanations for each item illuminate what to do, what not to do, and why.</div><div>&nbsp;</div><div>The third edition covers language and library features added in Java 7, 8, and 9, including the functional programming constructs that were added to its object-oriented roots. Many new items have been added, including a chapter devoted to lambdas and streams.</div><div>&nbsp;</div><div>New coverage includes</div><ul style=\"margin: 0px 0px 18px 20px; padding: 0px; font-family: Arial, sans-serif; font-size: 14px;\"><li style=\"margin: 0px 0px 0px 20px; overflow-wrap: break-word;\">Functional interfaces, lambda expressions, method references, and streams</li><li style=\"margin: 0px 0px 0px 20px; overflow-wrap: break-word;\">Default and static methods in interfaces</li><li style=\"margin: 0px 0px 0px 20px; overflow-wrap: break-word;\">Type inference, including the diamond operator for generic types</li><li style=\"margin: 0px 0px 0px 20px; overflow-wrap: break-word;\">The @SafeVarargs annotation</li><li style=\"margin: 0px 0px 0px 20px; overflow-wrap: break-word;\">The try-with-resources statement</li><li style=\"margin: 0px 0px 0px 20px; overflow-wrap: break-word;\">New library features such as the Optional<t>&nbsp;interface, java.time, and the convenience factory methods for collections</t></li></ul></div>', '0321356683', , 10.25, '2018-08-30', '2018-12-23 16:05:03', 1);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(3, 'Java 8 in Action', 'Alan Mycroft', 'Java 8 in Action is a clearly written guide to the new features of Java 8. The book covers lambdas, streams, and functional-style programming. With Java 8\'s functional features you can now write more concise code in less time, and also automatically benefit from multicore architectures. It\'s time to dig in!\r\n\r\nPurchase of the print book includes a free eBook in PDF, Kindle, and ePub formats from Manning Publications.\r\n\r\nAbout the Book\r\n\r\nEvery new version of Java is important, but Java 8 is a game changer. Java 8 in Action is a clearly written guide to the new features of Java 8. It begins with a practical introduction to lambdas, using real-world Java code. Next, it covers the new Streams API and shows how you can use it to make collection-based code radically easier to understand and maintain. It also explains other major Java 8 features including default methods, Optional, CompletableFuture, and the new Date and Time API.\r\n\r\nThis book is written for programmers familiar with Java and basic OO programming.\r\n\r\nWhat\'s Inside\r\n\r\nHow to use Java 8\'s powerful new features\r\nWriting effective multicore-ready applications\r\nRefactoring, testing, and debugging\r\nAdopting functional-style programming\r\nQuizzes and quick-check questions\r\nAbout the Authors\r\n\r\nRaoul-Gabriel Urma is a software engineer, speaker, trainer, and PhD candidate at the University of Cambridge. Mario Fusco is an engineer at Red Hat and creator of the lambdaj library. Alan Mycroft is a professor at Cambridge and cofounder of the Raspberry Pi Foundation.', '1617291994', , 15, '2014-08-28', '2018-10-07 11:56:08', 1);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(5, 'Java Generics and Collections', 'Maurice Naftalin, Philip Wadler', 'This comprehensive guide shows you how to master the most importantchanges to Java since it was first released. Generics and the greatlyexpanded collection libraries have tremendously increased the power ofJava 5 and Java 6. But they have also confused many developers whohaven\'t known how to take advantage of these new features.', '0596527756', , 27.99, '2006-10-27', '2018-09-19 06:16:34', 1);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(9, 'Spring in Action', 'Craig Walls ', 'Spring in Action, Fourth Edition is a hands-on guide to the Spring Framework, updated for version 4. It covers the latest features, tools, and practices including Spring MVC, REST, Security, Web Flow, and more. You\'ll move between short snippets and an ongoing example as you learn to build simple and efficient J2EE applications. Author Craig Walls has a special knack for crisp and entertaining examples that zoom in on the features and techniques you really need.', '161729120X', , 33.99, '2014-11-28', '2018-09-19 06:31:12', 2);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(10, 'Pro Spring 5', 'Iuliana Cosmina', 'Master Spring basics and core topics, and share the authors insights and realworld experiences with remoting, Hibernate, and EJB. Beyond the basics, you\'ll learn how to leverage the Spring Framework to build the various tiers and parts of an enterprise Java application: transactions, web and presentation tiers, deployment, and much more. A full sample application allows you to apply many of the technologies and techniques covered in Pro Spring 5 and see how they work together.\r\n\r\nThis book updates the perennial bestseller with the latest that the new Spring Framework 5 has to offer. Now in its fifth edition, this popular title is by far the most comprehensive and definitive treatment of Spring available. It covers the new functional web framework and interoperability with Java 9.\r\n\r\nAfter reading this definitive book, you\'ll be armed with the power of Spring to build complex Spring applications, top to bottom.\r\n\r\nThe agile, lightweight, open-source Spring Framework\r\n\r\ncontinues to be the de facto leading enterprise Java application development framework for today\'s Java programmers and developers. It works with other leading open-source, agile, and lightweight Java technologies such as Hibernate, Groovy, MyBatis, and more. Spring now works with Java EE and JPA 2 as well.\r\nWhat You\'ll Learn\r\n\r\nDiscover whats new in Spring Framework 5\r\nUse the Spring Framework with Java 9\r\nMaster data access and transactions \r\nWork with the new functional web framework \r\nCreate microservices and other web services \r\nWho This Book Is For\r\n\r\nExperienced Java and enterprise Java developers and programmers. Some experience with Spring highly recommended.  ', '9781484228074', , 33.99, '2017-10-17', '2018-10-03 15:53:58', 2);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(13, 'Grails in Action', 'Peter Ledbrook', 'Summary\r\n\r\nGrails in Action, Second Edition is a comprehensive introduction to Grails 2 focused on making you super-productive fast. In \r\n\r\nthis totally revised new edition, you\'ll master Grails 2.3 core skills as you apply TDD techniques to developing a full-\r\n\r\nscale Twitter clone. Along the way you\'ll learn the latest single-page web app UI techniques, work with NoSQL backends, \r\n\r\nintegrate with enterprise messaging, and implement a complete RESTful API for your services.\r\n\r\nPurchase of the print book includes a free eBook in PDF, Kindle, and ePub formats from Manning Publications.\r\n\r\nAbout the Technology\r\n\r\nIt may be time for you to stop reconfiguring, rewriting, and recompiling your Java web apps. Grails, a Groovy-powered web \r\n\r\nframework, hides all that busy work so you can concentrate on what your applications do, not how they\'re built. In addition \r\n\r\nto its famously intuitive dev environment and seamless integration with Spring and Hibernate, the new Grails 2.3 adds \r\n\r\nimproved REST support, better protection against attacks from the web, and better dependency resolution.\r\n\r\nAbout the Book\r\n\r\nGrails in Action, Second Edition is a comprehensive introduction to Grails 2. In this totally revised edition you\'ll master \r\n\r\nGrails as you apply TDD techniques to a full-scale example (a Twitter clone). Along the way you\'ll learn single-page web app \r\n\r\ntechniques, work with NoSQL back ends, integrate with enterprise messaging, implement a RESTful API ... and more.\r\n\r\nNo Java or Groovy knowledge is required. Some web development and OOP experience is helpful.\r\n\r\nWhat\'s Inside\r\n\r\nCovers Grails 2.3 from the ground up\r\nAgile delivery and testing using Spock\r\nHow to use and manage plugins\r\nTips and tricks from the trenches\r\nAbout the Authors\r\n\r\nThere\'s no substitute for experience: Glen Smith and Peter Ledbrook have been fixtures in the Grails community, contributing \r\n\r\ncode, blogging, and speaking at conferences worldwide, since Grails 0.2.\r\n\r\nTable of Contents\r\n\r\nPART 1 INTRODUCING GRAILS\r\nGrails in a hurry\r\nThe Groovy essentials\r\nPART 2 CORE GRAILS\r\nModeling the domain 63\r\nCreating the initial UI\r\nRetrieving the data you need\r\nControlling application flow\r\nServices and data binding\r\nDeveloping tasty forms, views, and layouts\r\nPART 3 EVERYDAY GRAILS\r\nBuilding reliable applications\r\nUsing plugins: just add water\r\nProtecting your application\r\nExposing your app to other programs\r\nSingle-page web applications (and other UI stuff)\r\nUnderstanding Spring and transactions\r\nPART 4 ADVANCED GRAILS\r\nUnderstanding events, messaging, and scheduling\r\nNoSQL and Grails\r\nBeyond compile, test, run\r\nGrails in the cloud\r\nBONUS ONLINE CHAPTERS\r\nAdvanced GORM kung fu\r\nDeveloping plugins', '1617290963', , 46.44, '2014-07-24', '2018-10-03 16:12:07', 2);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(14, 'GWT in Action', 'Adam Tacy, Robert Hanson', 'Summary\r\n\r\nGWT in Action, Second Edition is a completely revised edition of the best-selling GWT book. It covers the new features \r\n\r\nintroduced in GWT 2.4 and 2.5, as well as the best development practices that have emerged in the GWT community. It begins \r\n\r\nwith a rapid-fire introduction to GWT and Ajax to get you up to speed with GWT concepts and tools. Then, you\'ll explore key \r\n\r\nconcepts like managing events, interacting with the server, creating UI components, building your user interface \r\n\r\ndeclaratively using UiBinder ... and more.\r\n\r\nAbout the Technology\r\n\r\nGoogle Web Toolkit works on a simple idea. Write your web application in Java, and GWT crosscompiles it into JavaScript. It \r\n\r\nis open source, supported by Google, and version 2.5 now includes a library of high-quality interface components and \r\n\r\nproductivity tools that make using GWT a snap. The JavaScript it produces is really good.\r\n\r\nAbout this Book\r\n\r\nGWT in Action, Second Edition is a revised edition of the best-selling GWT book. In it, you\'ll explore key concepts like \r\n\r\nmanaging events, interacting with the server, and creating UI components. As you move through its engaging examples, you\'ll \r\n\r\nabsorb the latest thinking in application design and industry-grade best practices, such as implementing MVP, using \r\n\r\ndependency injection, and code optimization.\r\n\r\nWritten for Java developers, the book requires no prior knowledge of GWT.\r\n\r\nPurchase of the print book comes with an offer of a free PDF, ePub, and Kindle eBook from Manning. Also available is all \r\n\r\ncode from the book.\r\n\r\nWhat\'s Inside\r\n\r\nCovers GWT 2.4 and up\r\nEfficient use of large data sets\r\nOptimizing with client bundles, deferred binding, and code splitting\r\nUsing generators and dependency injection\r\nAbout the Authors\r\n\r\nAdam Tacy and Robert Hanson coauthored the first edition of GWT in Action. Jason Essington is a Java developer and an active \r\n\r\ncontributor to the GWT mailing list and the GWT IRC channel. Anna Tökke is a programmer and solutions architect working with \r\n\r\nGWT on a daily basis.\r\n\r\nTable of Contents\r\nPART 1 BASICS\r\nGWT\r\nBuilding a GWT application: saying \"Hello World!\"\r\nBuilding a GWT application: enhancing Hello World\r\nPART 2 NEXT STEPS\r\nCreating your own widgets\r\nUsing client bundles\r\nInterface design with UiBinder\r\nCommunicating with GWT-RPC\r\nUsing RequestFactory\r\nThe Editor framework\r\nData-presentation (cell) widgets\r\nUsing JSNIJavaScript Native Interface\r\nClassic Ajax and HTML forms\r\nInternationalization, localization, and accessibility\r\nPART 3 ADVANCED\r\nAdvanced event handling and event busses\r\nBuilding MVP-based applications\r\nDependency injection\r\nDeferred binding\r\nGenerators\r\nMetrics and code splitting', '1935182846', , 27.8, '2013-02-10', '2018-10-03 16:15:20', 2);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(15, 'The 4-Hour Workweek', 'Timothy Ferriss', 'The New York Times bestselling author of The 4-Hour Body shows readers how to live more and work less, now with more than \r\n\r\n100 pages of new, cutting-edge content.\r\n\r\nForget the old concept of retirement and the rest of the deferred-life planthere is no need to wait and every reason not \r\n\r\nto, especially in unpredictable economic times. Whether your dream is escaping the rat race, experiencing high-end world \r\n\r\ntravel, or earning a monthly five-figure income with zero management, The 4-Hour Workweek is the blueprint. \r\n\r\nThis step-by-step guide to luxury lifestyle design teaches: \r\n How Tim went from $40,000 per year and 80 hours per week to $40,000 per month and 4 hours per week\r\n How to outsource your life to overseas virtual assistants for $5 per hour and do whatever you want\r\n How blue-chip escape artists travel the world without quitting their jobs\r\n How to eliminate 50% of your work in 48 hours using the principles of a forgotten Italian economist\r\n How to trade a long-haul career for short work bursts and frequent mini-retirements\r\n\r\nThe new expanded edition of Tim Ferriss The 4-Hour Workweek includes:\r\n More than 50 practical tips and case studies from readers (including families) who have doubled income, overcome common \r\n\r\nsticking points, and reinvented themselves using the original book as a starting point\r\n Real-world templates you can copy for eliminating e-mail, negotiating with bosses and clients, or getting a private chef \r\n\r\nfor less than $8 a meal\r\n How Lifestyle Design principles can be suited to unpredictable economic times\r\n The latest tools and tricks, as well as high-tech shortcuts, for living like a diplomat or millionaire without being \r\n\r\neither', '9780307465351', , 16.32, '2009-12-15', '2018-10-03 16:20:13', 10);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(16, 'The Power of Habit', 'Charles Duhigg', 'NEW YORK TIMES BESTSELLER  This instant classic explores how we can change our lives by changing our habits.\r\n \r\nWith the days of pulling all-nighters and eating pizza at 2 a.m. (hopefully) behind your new grad, theres no time like the \r\n\r\npresent to get into a good routine.Real Simple\r\n \r\nNAMED ONE OF THE BEST BOOKS OF THE YEAR BY\r\nThe Wall Street Journal  Financial Times\r\n \r\nIn The Power of Habit, award-winning business reporter Charles Duhigg takes us to the thrilling edge of scientific \r\n\r\ndiscoveries that explain why habits exist and how they can be changed. Distilling vast amounts of information into \r\n\r\nengrossing narratives that take us from the boardrooms of Procter & Gamble to the sidelines of the NFL to the front lines of \r\n\r\nthe civil rights movement, Duhigg presents a whole new understanding of human nature and its potential. At its core, The \r\n\r\nPower of Habit contains an exhilarating argument: The key to exercising regularly, losing weight, being more productive, and \r\n\r\nachieving success is understanding how habits work. As Duhigg shows, by harnessing this new science, we can transform our \r\n\r\nbusinesses, our communities, and our lives.\r\n\r\nWith a new Afterword by the author\r\n \r\nSharp, provocative, and useful.Jim Collins\r\n \r\nFew [books] become essential manuals for business and living. The Power of Habit is an exception. Charles Duhigg not only \r\n\r\nexplains how habits are formed but how to kick bad ones and hang on to the good.Financial Times\r\n \r\nA flat-out great read.David Allen, bestselling author of Getting Things Done: The Art of Stress-Free Productivity\r\n \r\nYoull never look at yourself, your organization, or your world quite the same way.Daniel H. Pink, bestselling author of \r\n\r\nDrive and A Whole New Mind\r\n \r\nEntertaining . . . enjoyable . . . fascinating . . . a serious look at the science of habit formation and change.The New \r\n\r\nYork Times Book Review', '081298160X', , 15.26, '2014-01-07', '2018-10-05 05:00:06', 10);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(17, 'The 7 Habits of Highly Effective People', 'Stephen R. Covey', 'This twenty-fifth anniversary edition of Stephen Coveys cherished classic commemorates the timeless wisdom of the 7 Habits.\r\n\r\nOne of the most inspiring and impactful books ever written, The 7 Habits of Highly Effective People has captivated readers \r\n\r\nfor 25 years. It has transformed the lives of Presidents and CEOs, educators and parents in short, millions of people of \r\n\r\nall ages and occupations.', '9781451639612', , 16.2, '2013-11-19', '2018-10-05 05:04:13', 10);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(18, 'How to Win Friends & Influence People', 'Dale Carnegie', 'You can go after the job you wantand get it!\r\n\r\nYou can take the job you haveand improve it!\r\n\r\nYou can take any situationand make it work for you!\r\n\r\nDale Carnegies rock-solid, time-tested advice has carried countless people up the ladder of success in their business and \r\n\r\npersonal lives. One of the most groundbreaking and timeless bestsellers of all time, How to Win Friends & Influence People \r\n\r\nwill teach you:\r\n\r\n-Six ways to make people like you\r\n\r\n-Twelve ways to win people to your way of thinking\r\n\r\n-Nine ways to change people without arousing resentment\r\n\r\nAnd much more! Achieve your maximum potentiala must-read for the twenty-first century with more than 15 million copies \r\n\r\nsold!', '0671027034', , 9.6, '1998-10-01', '2018-10-05 05:11:33', 10);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(19, 'Think and Grow Rich ', 'Napoleon Hill', 'This is Napoleon Hill\'s definitive landmark book (revised and updated for the 21st century) on how to unleash your full \r\n\r\npotential and achieve guaranteed success in life and work, by following the principles outlined in this book. This book will \r\n\r\nalso teach you how-to conquer many common fears, such as Poverty, Ill Health, Criticism, Loss of Love and Death. \"Think and \r\n\r\nGrow Rich\", indispensable reading for personal achievement.', '1453644911', , 13.95, '2010-06-21', '2018-10-05 05:16:35', 10);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(20, 'Marketing', 'Brian Tracy', 'The success or failure of your business depends on the success or failure of your marketing efforts. If you can identify \r\n\r\nwhat your customers want, need, and can afford--and then give it to them--you will achieve outstanding results. Filled with \r\n\r\nBrian Tracy\'s trademark wisdom, this indispensable guide contains 21 powerful ideas you can use to immediately improve your \r\n\r\nstrategic marketing results. You\'ll discover how to: Build your customer base Set yourself apart from the competition Answer \r\n\r\nthree crucial questions about any new product or service Use market research and focus groups to fuel better decisions \r\n\r\nFulfill a basic emotional need for buyers Determine the correct price point for your offerings Become truly customer-focused \r\n\r\nMake the most of your distribution channels Master the concepts of specialization, differentiation, segmentation, and \r\n\r\nconcentration Give customers a reason to switch from your competitors And more Packed with time-tested marketing strategies, \r\n\r\nthis practical and portable book shows you how to overcome the competition, increase sales and profitability, and dominate \r\n\r\nyour market niche.', '9780814434215', , 9.95, '2014-06-11', '2018-10-05 05:22:51', 4);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(21, 'Differentiate or Die', 'Jack Trout', 'A newly revised and expanded edition of the revolutionary business classic, Differentiate or Die, Second Edition shows you \r\n\r\nhow to differentiate your products, services, and business in order to dominate the competition. Veteran marketing guru Jack \r\n\r\nTrout uses real-world examples and his own unique insight to show you how to bind customers to your products for long-term \r\n\r\nsuccess and loyalty. This edition includes new case studies, new research, and updated examples from around the world.', '0470223391', , 26.95, '2008-03-07', '2018-10-05 05:30:26', 4);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(22, 'The 22 Immutable Laws of Marketing', 'Al Ries', 'There are laws of nature, so why shouldn\'t there be laws of marketing?\r\n\r\nAs Al Ries and Jack Troutthe world-renowned marketing consultants and bestselling authors of Positioningnote, you can \r\n\r\nbuild an impressive airplane, but it will never leave the ground if you ignore the laws of physics, especially gravity. Why \r\n\r\nthen, they ask, shouldn\'t there also be laws of marketing that must be followed to launch and maintain winning brands? In \r\n\r\nThe 22 Immutable Laws of Marketing, Ries and Trout offer a compendium of twenty-two innovative rules for understanding and \r\n\r\nsucceeding in the international marketplace. From the Law of Leadership, to The Law of the Category, to The Law of the Mind, \r\n\r\nthese valuable insights stand the test of time and present a clear path to successful products. Violate them at your own \r\n\r\nrisk.', '0887306667', , 13, '1994-04-27', '2018-10-05 05:34:00', 4);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(23, 'Blue Ocean Strategy', 'W. Chan Kim & Renee Mauborgne', 'The global phenomenon that has sold 3.6 million copies, is published in a record-breaking 44 languages and is a bestseller across five continents&#8213;now updated and expanded with new content\r\n\r\nIn this perennial bestseller, embraced by organizations and industries worldwide, globally preeminent management thinkers W. Chan Kim and Renee Mauborgne challenge everything you thought you knew \r\n\r\nabout the requirements for strategic success. Recognized as one of the most iconic and impactful strategy books ever written, Blue Ocean Strategy, now updated with fresh content from the authors, \r\n\r\nargues that cutthroat competition results in nothing but a bloody red ocean of rivals fighting over a shrinking profit pool. Based on a study of 150 strategic moves (spanning more than 100 years \r\n\r\nacross 30 industries), the authors argue that lasting success comes not from battling competitors but from creating blue oceans&#8213;untapped new market spaces ripe for growth.\r\n\r\nBlue Ocean Strategy presents a systematic approach to making the competition irrelevant and outlines principles and tools any organization can use to create and capture their own blue oceans. This \r\n\r\nexpanded edition includes:\r\n\r\nA new preface by the authors: Help! My Ocean Is Turning Red\r\nUpdates on all cases and examples in the book, bringing their stories up to the present time\r\nTwo new chapters and an expanded third one &#8213; Alignment, Renewal, and Red Ocean Traps &#8213; that address the most pressing questions readers have asked over the past 10 years\r\nA landmark work that upends traditional thinking about strategy, this bestselling book charts a bold new path to winning the future. Consider this your guide to creating uncontested market \r\n\r\nspace&#8213;and making the competition irrelevant.\r\n\r\nTo learn more about the power of blue ocean strategy, visit blueoceanstrategy.com. There youll find all the resources you need&#8213;from ideas in practice and cases from government and private \r\n\r\nindustry, to teaching materials, mobile apps, real-time updates, and tips and tools to help you make your blue ocean journey a success.\r\n', '1625274491', , 21.75, '2015-01-20', '2018-10-05 09:25:50', 4);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(24, 'Positioning: The Battle for Your Mind', 'Al Ries & Jack Trout', 'The first book to deal with the problems of communicating to a skeptical, media-blitzed public, Positioning describes a \r\n\r\nrevolutionary approach to creating a \"position\" in a prospective customer\'s mind-one that reflects a company\'s own strengths \r\n\r\nand weaknesses as well as those of its competitors. Writing in their trademark witty, fast-paced style, advertising gurus \r\n\r\nRies and Trout explain how to:\r\n\r\nMake and position an industry leader so that its name and message wheedles its way into the collective subconscious of your \r\n\r\nmarket-and stays there\r\nPosition a follower so that it can occupy a niche not claimed by the leader\r\nAvoid letting a second product ride on the coattails of an established one.\r\nPositioning also shows you how to:\r\n\r\nUse leading ad agency techniques to capture the biggest market share and become a household name\r\nBuild your strategy around your competition\'s weaknesses\r\nReposition a strong competitor and create a weak spot\r\nUse your present position to its best advantage\r\nChoose the best name for your product\r\nDetermine when-and why-less is more\r\nAnalyze recent trends that affect your positioning.\r\nRies and Trout provide many valuable case histories and penetrating analyses of some of the most phenomenal successes and \r\n\r\nfailures in advertising history. Revised to reflect significant developments in the five years since its original \r\n\r\npublication, Positioning is required reading for anyone in business today.\r\n', '9780071373586', , 12.94, '2001-01-03', '2018-10-05 05:42:06', 4);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(25, 'The Principles of Beautiful Web Design', 'Jason Beaird & James George', 'The Principles of Beautiful Web Design is the ideal book for people who can build websites, but are seeking the skills and \r\n\r\nknowledge to visually enhance their sites.\r\n\r\nThis book will teach you how to:\r\n\r\nUnderstand what makes \"good design,\" from discovery through to implementation\r\nUse color effectively, develop color schemes, and create a palette\r\nCreate pleasing layouts using grids, the rule of thirds, and symmetry\r\nEmploy textures: lines, points, shapes, volumes, and depth\r\nApply typography to make ordinary designs look great\r\nChoose, edit, and position effective imagery\r\nAnd lots more...\r\n\r\n\r\n\r\nThis easy-to-follow guide is illustrated with beautiful, full-color examples, and will lead you through the process of \r\n\r\ncreating great designs from start to finish. \r\n\r\nThe third edition of this book has been greatly revised and now features:\r\n\r\nUpdated and expanded coverage of mobile and responsive web design (RWD)\r\nA new sample project\r\nNew sections on user interface and icon design\r\nCommon user-interface patterns and resources', '0992279445', , 32.65, '2014-06-27', '2018-10-05 05:49:29', 9);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(26, 'Web Design with HTML, CSS, JavaScript and jQuery Set', 'Jon Duckett ', 'A two-book set for web designers and front-end developers\r\nThis two-book set combines the titles HTML & CSS: Designing and Building Web Sites and JavaScript & jQuery: Interactive Front-End Development. Together these two books form an ideal platform for anyone who wants to master HTML and CSS before stepping up to JavaScript and jQuery.\r\n\r\nHTML & CSS covers structure, text, links, images, tables, forms, useful options, adding style with CSS, fonts, colors, thinking in boxes, styling lists and tables, layouts, grids, and even SEO, Google analytics, ftp, and HTML5. JavaScript & jQuery offers an excellent combined introduction to these two technologies using a clear and simple visual approach using diagrams, infographics, and photographs.\r\n\r\nA handy two-book set that uniquely combines related technologies\r\nHighly visual format and accessible language makes these books highly effective learning tools\r\nPerfect for beginning web designers and front-end developers', '1118907442', , 31.8, '2014-07-08', '2018-10-05 05:52:21', 9);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(27, 'Design for Hackers', 'David Kadavy', 'The smash hit web design book that debuted at #18 on Amazon.\r\n\r\nWeb design isn\'t just about knowing HTML, CSS, and JavaScript. When it comes to web design for developers or web design for \r\n\r\nprogrammers, you need to know design principles to make beautiful and engaging interfaces.\r\n\r\nHackers are able to accomplish so much in so little time because they come from a community that\'s built upon sharing \r\n\r\nknowledge. When it comes to programming, they can learn whatever they need to learn by reading manuals, or simply typing in \r\n\r\na Google search. But learning design isn\'t so simple.\r\n\r\nMany design books try to teach design through lists of \"do\'s\" and \"don\'ts.\" But hackers know you need a deeper understanding \r\n\r\nof something to really do it well. Design for Hackers takes apart design by \"reverse-engineering\" Impressionist painting, \r\n\r\nRenaissance sculpture, the Mac OS X Aqua interface, Twitter\'s web interface, and much more. You\'ll learn about color theory, \r\n\r\ntypography, proportions, and design principles. This theoretical advice is mixed with concrete, actionable advice such as \r\n\r\nsuggestions for color scheme tools, and a chart of \"all of the fonts you\'ll ever need.\"\r\n\r\nWhether you\'re doing interaction design, user interface design, user experience design, iOS/Android mobile design, or good \r\n\r\nold-fashioned \"web design,\" by the end of the book, you\'ll be seeing design through new eyes.', '9781119998952', , 35.99, '2011-08-29', '2018-10-05 05:56:08', 9);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(28, 'Don\'t Make Me Think', 'Steve Krug', 'Five years and more than 100,000 copies after it was first published, it\'s hard to imagine anyone working in Web design who \r\n\r\nhasn\'t read Steve Krug\'s \"instant classic\" on Web usability, but people are still discovering it every day.  In this second \r\n\r\nedition, Steve adds three new chapters in the same style as the original: wry and entertaining, yet loaded with insights and \r\n\r\npractical advice for novice and veteran alike.  Don\'t be surprised if it completely changes the way you think about Web \r\n\r\ndesign. With these three new chapters:\r\nUsability as common courtesy -- Why people really leave Web sites\r\nWeb Accessibility, CSS, and you -- Making sites usable and accessible\r\nHelp! My boss wants me to ______. -- Surviving executive design whims\r\n\"I thought usability was the enemy of design until I read the first edition of this book.  Don\'t Make Me Think! showed me \r\n\r\nhow to put myself in the position of the person who uses my site.  After reading it over a couple of hours and putting its \r\n\r\nideas to work for the past five years, I can say it has done more to improve my abilities as a Web designer than any other \r\n\r\nbook.\r\n\r\nIn this second edition, Steve Krug adds essential ammunition for those whose bosses, clients, stakeholders, and marketing \r\n\r\nmanagers insist on doing the wrong thing.  If you design, write, program, own, or manage Web sites, you must read this \r\n\r\nbook.\"  -- Jeffrey Zeldman, author of Designing with Web Standards', '9780321344755', , 32.54, '2005-08-28', '2018-10-05 05:58:56', 9);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(29, 'The Power of Now', 'Eckhart Tolle', 'It\'s no wonder that The Power of Now has sold over 2 million copies worldwide and has been translated into over 30 foreign \r\n\r\nlanguages. Much more than simple principles and platitudes, the book takes readers on an inspiring spiritual journey to find \r\n\r\ntheir true and deepest self and reach the ultimate in personal growth and spirituality: the discovery of truth and light. \r\n\r\nIn the first chapter, Tolle introduces readers to enlightenment and its natural enemy, the mind. He awakens readers to their \r\n\r\nrole as a creator of pain and shows them how to have a pain-free identity by living fully in the present. The journey is \r\n\r\nthrilling, and along the way, the author shows how to connect to the indestructible essence of our Being, \"the eternal, \r\n\r\never-present One Life beyond the myriad forms of life that are subject to birth and death.\" \r\n\r\nFeaturing a new preface by the author, this paperback shows that only after regaining awareness of Being, liberated from \r\n\r\nMind and intensely in the Now, is there Enlightenment.', '1577314808', , 9.45, '2004-08-09', '2018-10-05 09:16:19', 10);
INSERT INTO `book` (`book_id`, `title`, `author`, `description`, `isbn`, `image`, `price`, `publish_date`, `last_update_time`, `category_id`) VALUES
(30, 'Mans Search For Meaning', 'Viktor E. Frankl', 'Psychiatrist Viktor Frankl\'s memoir has riveted generations of readers with its descriptions of life in Nazi death camps and \r\n\r\nits lessons for spiritual survival. Between 1942 and 1945 Frankl labored in four different camps, including Auschwitz, while \r\n\r\nhis parents, brother, and pregnant wife perished. Based on his own experience and the experiences of others he treated later \r\n\r\nin his practice, Frankl argues that we cannot avoid suffering but we can choose how to cope with it, find meaning in it, and \r\n\r\nmove forward with renewed purpose. Frankl\'s theory-known as logotherapy, from the Greek word logos (\"meaning\")-holds that \r\n\r\nour primary drive in life is not pleasure, as Freud maintained, but the discovery and pursuit of what we personally find \r\n\r\nmeaningful.\r\n\r\nAt the time of Frankl\'s death in 1997, Man\'s Search for Meaning had sold more than 10 million copies in twenty-four \r\n\r\nlanguages. A 1991 reader survey for the Library of Congress that asked readers to name a \"book that made a difference in \r\n\r\nyour life\" found Man\'s Search for Meaning among the ten most influential books in America.', '9780807014295', , 9.89, '2006-06-01', '2018-10-05 09:21:15', 10);

